import styled from "styled-components";

export const HomePageContainer = styled.div`
  display: flex;
  flex-direction: column;
  align-items: center;
  padding: 80px 80px;
`;

export const Circle = styled.div`
  width: 150px;
  height: 150px;
  border-radius: 50%;
  font-size: 20px;
  /*color: #fff;*/
  line-height: 150px;
  /*text-align: center; */
  justify-content: center;
  /*align-items: center;*/
  /*border-radius: 100%;*/
  text-align: center;
  justify-content: "space-between";
  margin-right: 50px;
  /*display: flex;*/
  /*color: "#ff0000";*/
`;

export const RectBox = styled.div`
border-radius: 25px;
  border: 2px solid #73AD21;
  width: auto;
  height: auto;
  margin-left:115px;
`;
